import React from 'react';
import { Router } from '@reach/router';

import Octicon, { Beaker, MarkGithub } from '@primer/octicons-react';
import {
    Navbar, Button, Divider, Alignment, Classes, Colors
} from '@blueprintjs/core';
import { Flex, Container } from './lib/utils';

import { siteWidth } from '../constants';

const Home = () => (<>
    <Flex style={{ height: '100vh', backgroundColor: Colors.BLACK }}
        className={Classes.DARK}
    >
        <Navbar style={{ backgroundColor: Colors.BLACK }}>
            <Container>
                <Navbar.Group align={Alignment.LEFT}>
                    <Navbar.Heading>
                        <Button minimal text='votsec' />
                    </Navbar.Heading>
                    <Divider />
                    <Button minimal icon={<Octicon icon={Beaker} />} />
                    <Button minimal icon={<Octicon icon={MarkGithub} />} />
                </Navbar.Group>

                <Navbar.Group align={Alignment.RIGHT}>
                    <Button minimal text='Login' />
                    <Divider />
                    <Button text='Join Now' intent='primary' />
                </Navbar.Group>
            </Container>
        </Navbar>

        <Flex direction='row' style={{ flexGrow: 1 }}>
            <Container style={{ paddingBottom: '4em', alignSelf: 'center' }}>
                <h1 className='hero-header'>
                    Vote your <span className='hero-highlight'>mind</span>
                </h1>
            </Container>
        </Flex>

        <style jsx>{`
            .hero-header {
                margin: 0;
                font-size: 5em;
                text-align: center;
            }

            .hero-highlight {
                color: ${Colors.BLUE1};
            }

            @media (min-width: ${siteWidth}) {
                .hero-header {
                    font-size: 7.5em;
                }
            }
        `}</style>
    </Flex>
</>);

const Lab = () => (
    <p>
        This is the lab
    </p>
);

const App = () => (
    <Router>
        <Home path='/' />
        <Lab path='/lab' />
    </Router>
);

export default App;
